*
 * 解析 `clientEvent`，根据与客户端的约定，传递过来的事件参数是在 data 的 param 属性中。
 * @example
 * document.addEventListener('clientEvent', (data) => {
 *    alert( JSON.stringify(data, null, 2) );
 *    // data.param = {
 *    //     event: 'eventName',
 *    //     data: {},
 *    // }
 *
 *    const parsed = parseClientEvent(data);
 *
 *    // parsed = {
 *    //     eventName: 'eventName',
 *    //     eventData: {},
 *    // }
 * });
 * @param {Object} event - 从客户端传递来的事件
 * @param {Object} event.param - 客户端事件内容的封装
 * @param {string} event.param.event - 客户端事件的服务名
 * @param {*} [event.param.data] - 事件的 payload
 *
 * @return {(Object|null)} - 解析出来的事件信息
 * @property {string} eventName - 解析出来的事件名
 * @property {*} [eventData] - 解析出来的事件 payload

